import "./App.css";
import { useState } from "react";

import {
  BrowserRouter,
  Routes,
  Route,
  Router,
} from "react-router-dom";


import home from "./components/Home";
import search from "./components/Search";



function App() {

  return (
    <Router>
      <div className="app">
        <Routes >
          <Route path="/search" >
              <Search />
          </Route>
          <Route path="/" >
            <Home />
          </Route>
        </Routes >



      </div>

    </Router>
  );
}

export default App;
